import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open cart modal
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');
    await page.waitForSelector('#cartModal', { timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_opened.png'));

    // Get current quantity of first cart item
    const initialQuantity = await page.$eval('.cart-item:first-child .quantity', el => parseInt(el.textContent.trim()));

    // Increase quantity by clicking the plus button
    await page.waitForSelector('.cart-item:first-child .quantity-btn:last-child', { timeout: 5000 });
    await page.click('.cart-item:first-child .quantity-btn:last-child');

    // Wait for quantity to update
    await page.waitForFunction(
      (initialQty) => {
        const currentQty = parseInt(document.querySelector('.cart-item:first-child .quantity').textContent.trim());
        return currentQty === initialQty + 1;
      },
      { timeout: 5000 },
      initialQuantity
    );

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_quantity_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_quantity_updated.png'));

    // Extract updated data
    const updatedQuantity = await page.$eval('.cart-item:first-child .quantity', el => parseInt(el.textContent.trim()));
    const productName = await page.$eval('.cart-item:first-child .cart-item-title', el => el.textContent.trim());
    const productPrice = await page.$eval('.cart-item:first-child .cart-item-price', el => el.textContent.trim());

    return {
      success: true,
      action: "Updated cart item quantity from " + initialQuantity + " to " + updatedQuantity,
      extractedData: {
        productName: productName,
        initialQuantity: initialQuantity,
        updatedQuantity: updatedQuantity,
        productPrice: productPrice
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to update cart item quantity",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
